import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header style={{ backgroundColor: "#B7F3FF", padding: "20px" }}>
        <h1>빨랑 빨래</h1>
        <div>
          <span>회원가입</span>
          <span> | </span>
          <span>로그인</span>
        </div>
      </header>
      <main>
        <div style={{ padding: "20px", textAlign: "center" }}>
          <h2>메인 화면</h2>
          <p>앱이 정상적으로 로드되었습니다.</p>
        </div>
      </main>
    </div>
  );
}

export default App;
